import React from 'react';
import { StyleSheet, Text, View ,Image,Button,Icon} from 'react-native';


const style = StyleSheet.create({
  container: {
    flex: 1,
  },
  slideContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
 
});
 
 class Reg  extends React.Component {
  render() {
    return (
      
      <View style={{ width: '14%' ,alignSelf:'center',borderRadius: 10  }}  >
        
        <Button
  icon={
    <Icon
      name="arrow-right"
      size={15}
      color="white"
marginTop='10%'
    />
    
  }
  title="Login"
/>
<Button
  icon={
    <Icon
      name="arrow-right"
      size={15}
      color="white"
         />
    
  }
  title="Register"
/>


  </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width:'60%',
  
  },
  slideContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    
  },
 
});
export default Reg;
